import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";
import CharacterSheet from "./character-sheet-component";
import MonsterLifeTracker from "./monster-life-tracker"; // Importa el nuevo componente
import "./style/tailwind.css";

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/character-sheet">Character Sheet</Link>
            </li>
            <li>
              <Link to="/monster-life-tracker">Monster Life Tracker</Link>{" "}
              {/* Nuevo enlace */}
            </li>
          </ul>
        </nav>

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/character-sheet" element={<CharacterSheet />} />
          <Route
            path="/monster-life-tracker"
            element={<MonsterLifeTracker />}
          />{" "}
          {/* Nueva ruta */}
        </Routes>
      </div>
    </Router>
  );
};

const Home = () => (
  <div>
    <h2>Home</h2>
  </div>
);

export default App;
